        private void Form2_FormClosed(object sender, FormClosedEventArgs e)
        {
            if (Module1.flag_checking > 0)
            {
                MyProject.Forms.SolarBatteryController.Timer1.Enabled = true;
                MyProject.Forms.SolarBatteryController.Button1.Enabled = false;
                MyProject.Forms.SolarBatteryController.Button2.Enabled = true;
            }
        }

        private void Form2_Load(object sender, EventArgs e)
        {
            this.tickcount2 = 0;
            this.Flag_recok2 = 0;
            this.totaltickcount = 0;
            MyProject.Forms.SolarBatteryController.SerialPort1.DiscardInBuffer();
        }

        private void Button9_Click(object sender, EventArgs e)
        {
            Module1.buscmd = 3;
            MyProject.Forms.SolarBatteryController.Sendcmd(36864, 3, 61);
            this.flag_Pararead1 = 1;
            this.Timer1.Enabled = true;
            this.Button9.Enabled = false;
            this.Button10.Enabled = false;
        }

        private void Timer1_Tick(object sender, EventArgs e)
        {
            checked
            {
                this.tickcount2 += 1;
                this.totaltickcount++;
                byte i = (byte)MyProject.Forms.SolarBatteryController.SerialPort1.BytesToRead;
                if ((int)i > Module1.CmdLenth)
                {
                    MyProject.Forms.SolarBatteryController.SerialPort1.DiscardInBuffer();
                }
                if ((int)i == Module1.CmdLenth)
                {
                    MyProject.Forms.SolarBatteryController.SerialPort1.Read(this.recbuf2, 0, Module1.CmdLenth);
                    if ((int)this.recbuf2[0] == Module1.ID & this.recbuf2[1] == Module1.buscmd)
                    {
                        MyProject.Forms.SolarBatteryController.crc16(ref this.recbuf2, Module1.CmdLenth - 3);
                        if (this.recbuf2[Module1.CmdLenth - 2] == Module1.HiByte & this.recbuf2[Module1.CmdLenth - 1] == Module1.LoByte)
                        {
                            this.Flag_recok2 = 1;
                            if (Module1.buscmd == 3)
                            {
                                if (this.flag_Pararead1 == 1)
                                {
                                    this.HVD = (float)((int)this.recbuf2[7] * 256);
                                    unchecked
                                    {
                                        this.HVD += (float)this.recbuf2[8];
                                        this.HVD /= 100f;
                                        this.CLV = (float)(checked((int)this.recbuf2[9] * 256));
                                        this.CLV += (float)this.recbuf2[10];
                                        this.CLV /= 100f;
                                        this.OVR = (float)(checked((int)this.recbuf2[11] * 256));
                                        this.OVR += (float)this.recbuf2[12];
                                        this.OVR /= 100f;
                                        this.ECV = (float)(checked((int)this.recbuf2[13] * 256));
