        private void TextBox1_KeyPress(object sender, KeyPressEventArgs e)
        {
            if (char.IsDigit(e.KeyChar) | e.KeyChar == '\b' | Operators.CompareString(Conversions.ToString(e.KeyChar), ".", false) == 0)
            {
                if (Operators.CompareString(Conversions.ToString(e.KeyChar), ".", false) == 0 & Strings.InStr(this.TextBox1.Text, ".", CompareMethod.Binary) > 0)
                {
                    e.Handled = true;
                }
                else
                {
                    e.Handled = false;
                }
            }
            else
            {
                e.Handled = true;
            }
        }

