        public void PortClose()
        {
            try
            {
                this.SerialPort1.DiscardInBuffer();
                this.SerialPort1.Close();
            }
            catch (Exception expr_18)
            {
                ProjectData.SetProjectError(expr_18);
                Interaction.MsgBox("The serial port is not opened or the serial port is abnormal！", MsgBoxStyle.Information, "Error！");
                ProjectData.ClearProjectError();
            }
        }

        private void Form1_FormClosed(object sender, FormClosedEventArgs e)
        {
            this.PortClose();
        }

        private void Form1_Load(object sender, EventArgs e)
        {
            this.i = 0;
            this.mycount = 0;
            this.cycle = 0;
            this.TextBox2.Text = "1";
        }

        private void Timer1_Tick(object sender, EventArgs e)
        {
            this.i = this.SerialPort1.BytesToRead;
            this.Textfault.Text = Conversions.ToString(this.i);
            if (this.i > Module1.CmdLenth)
            {
                this.SerialPort1.DiscardInBuffer();
            }
            checked
            {
                if (this.i == Module1.CmdLenth)
                {
                    this.i = 0;
                    this.SerialPort1.Read(this.recBuf, 0, Module1.CmdLenth);
                    if ((int)this.recBuf[0] == Module1.ID & this.recBuf[1] == Module1.buscmd)
                    {
                        this.crc16(ref this.recBuf, Module1.CmdLenth - 3);
                        if (this.recBuf[Module1.CmdLenth - 2] == Module1.HiByte & this.recBuf[Module1.CmdLenth - 1] == Module1.LoByte)
                        {
                            this.Flag_recok = 1;
                            if (this.cycle == 0)
                            {
                                this.BV_Real = (float)((int)this.recBuf[11] * 256);
                                unchecked
                                {
                                    this.BV_Real += (float)this.recBuf[12];
                                    this.BV_Real /= 100f;
                                    this.BI_Real = (float)(checked((int)this.recBuf[13] * 256));
                                    this.BI_Real += (float)this.recBuf[14];
                                    this.BI_Real /= 100f;
                                    this.PV_Real = (float)(checked((int)this.recBuf[3] * 256));
                                    this.PV_Real += (float)this.recBuf[4];
                                    this.PV_Real /= 100f;
                                    this.PI_Real = (float)(checked((int)this.recBuf[5] * 256));
                                    this.PI_Real += (float)this.recBuf[6];
                                    this.PI_Real /= 100f;
                                    this.PP_RealH = (float)(checked((int)this.recBuf[9] * 256));
                                    this.PP_RealH += (float)this.recBuf[10];
                                    this.PP_RealL = (float)(checked((int)this.recBuf[7] * 256));
                                    this.PP_RealL += (float)this.recBuf[8];
                                    this.PP_RealH *= 65536f;
                                    this.PP_Real = this.PP_RealH + this.PP_RealL;
                                    this.PP_Real /= 100f;
                                }
                                this.TI_Real = (int)this.recBuf[61] * 256;
                                this.TI_Real += (int)this.recBuf[62];
                                this.Tout_Real = (int)this.recBuf[59] * 256;
                                this.Tout_Real += (int)this.recBuf[60];
                                this.LV_Real = (float)((int)this.recBuf[27] * 256);
                                unchecked
                                {
                                    this.LV_Real += (float)this.recBuf[28];
